import React from 'react';

import projectBoxImages from '../Images/ProjectImage.png'

export default function DashboardBoxProjectsRow() {
  return (
    <>
        <div className='project-box'>
            <div className='content'>
                <span></span>
            </div>
            <div className='iamge'>
                <img src={projectBoxImage}/>
            </div>
        </div>
    </>
  )
}
